    @Test
    public void getAllIssuesTest() {
        List<Issue> issues = new ArrayList<>();
        issues.add(getTestIssueObject("IssueTitle1"));
        issues.add(getTestIssueObject("IssueTitle2"));
        issues.add(getTestIssueObject("IssueTitle3"));
        issues.add(getTestIssueObject("IssueTitle4"));

        Mockito.doReturn(issues).when(issuesRepository).findAll();
        String actual = issuesController.getAllIssues();

        Assert.assertEquals(issues.stream().map(Issue::getTitle).collect(Collectors.toList()), getNames(actual));
        Mockito.verify(issuesRepository).findAll();
    }

    private List<String> getNames(String issues) {
        List<String> issuesNames = new ArrayList<>();
        JsonArray issuesJson = (JsonArray) new JsonParser().parse(issues);
        issuesJson.forEach(j -> issuesNames.add(((JsonObject)j).get("title").getAsString()));
        return issuesNames;
    }

    @Test
    public void getIssueByIdTest() throws ResourceNotFoundException, IOException {
        int id = 1;

        Optional<Issue> issue = Optional.of(getTestIssueObject("IssueTitle1"));
        issue.get().setId(id);

        Mockito.doReturn(issue).when(issuesRepository).findById(id);

        JsonObject jsonObject = new JsonParser().parse(issuesController.getIssuesById(id)).getAsJsonObject();//Got String, Convert into JSonObject to get Body, to recreate the Issue
        Issue actual = new Gson().fromJson(jsonObject.get("body"), Issue.class);

        Assert.assertEquals(issue.get().getTitle(),actual.getTitle());
        Mockito.verify(issuesRepository).findById(id);
    }

    @Test
    public void getIssuesByWriterTest() throws ResourceNotFoundException {
        int writerId = 1;

        List<Issue> issues = new ArrayList<>();
        issues.add(getTestIssueObject("Test_issue1",1));
        issues.add(getTestIssueObject("Test_issue2",1));
        issues.add(getTestIssueObject("Test_issue3",1));


        Mockito.doReturn(issues).when(issuesRepository).findByWriter(writerId);

        JsonObject jsonObject = new JsonParser().parse(issuesController.getIssuesByWriter(writerId)).getAsJsonObject();


        //JsonArray jsonArray = new Gson().fromJson(jsonObject.get("body"),JsonArray.class).getAsJsonArray();
        Type listType = new TypeToken<ArrayList<Issue>>(){}.getType();
        List<Issue> actual = new Gson().fromJson(jsonObject.get("body"), listType);

        Assert.assertEquals(issues.size(),actual.size());
        Assert.assertEquals(issues.get(0).getTitle(),actual.get(0).getTitle());
        Assert.assertEquals(issues.get(1).getTitle(),actual.get(1).getTitle());
        Assert.assertEquals(issues.get(2).getTitle(),actual.get(2).getTitle());
        Mockito.verify(issuesRepository).findByWriter(1);
    }

